import React from 'react';

const ProfilePage = ({ user }) => {
    if (!user) {
        return <p>Loading...</p>; // Handle unauthenticated state
    }

    return (
        <div>
            <h1>Welcome, {user.name}!</h1>
            <p>Email: {user.email}</p>
        </div>
    );
};

export default ProfilePage;
